import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import Rating from "./Rating";

export default function Demo_F2() {
    let names =[
        {name:"Ram" ,branch:"IT" ,value:5},
        {name:"Abhay" ,branch:"AI" ,value:2},
        {name:"Sita" ,branch:"DS" ,value:4},
        {name:"Hanuman" ,branch:"CSE" ,value:5},
    ];
    return (
        <>
        { names.map(
            (obj)=>{ 
                return (
                    <div className='col-sm-2'>
                    <div className="card">
                        <img src="image/image1.png" className="card-img-top rounded mx-auto d-block" alt="..."/>
                            <div className="card-body">
                                <h5 className="card-title">{obj.name}</h5>
                                <h5 className="card-title">{obj.branch}</h5>
                                <Rating value={obj.value} />
                                <a href="https://www.youtube.com/" className="btn btn-primary">Buy</a>
                            </div>
                    </div>
    
                </div>
                )
                } 
         ) 
        }
           

        </>

    )
}



const App = () => {
  const ratingValue = 4; // Replace this value with the dynamic rating value you want to show

  return (
    <div>
      <h1>Rating Component Example</h1>
     
    </div>
  );
};
